std::vector<PLC::MultiChannel> PLC::MultiChannel::activate(size_t nb_loop)
{
    std::vector<MultiChannel> result;

    for (size_t i = 0; i < nb_loop; ++i) {
        MultiChannel tmp(this->tab, this->kernels, this->ms, this->ss, this->hs, this->sources, this->destinations, this->time);
        result.push_back(tmp);
        this->run();
    }
    return result;
}

void PLC::MultiChannel::run()
{
    std::vector<std::vector<std::vector<double>>> us = this->calculate();
    std::vector<std::vector<std::vector<double>>> gs = this->growth(us);

    for (size_t idx = 0; idx < gs.size(); ++idx) {
        for (size_t i = 0; i < gs[idx].size(); ++i) {
            for (size_t j = 0; j < gs[idx][i].size(); ++j) {
                this->tab[idx][i][j] += this->time * gs[idx][i][j];
                if (this->tab[idx][i][j] < 0) {
                    this->tab[idx][i][j] = 0;
                }
                if(this->tab[idx][i][j] > 1) {
                    this->tab[idx][i][j] = 1;
                }
            }
        }
    }
}

void PLC::MultiChannel::show()
{
    printMatrixColor(this->tab);
}

std::vector<std::vector<std::vector<double>>> PLC::MultiChannel::calculate()
{
    int nb = this->tab.size();
    int rows = this->tab[0].size();
    int cols = this->tab[0][0].size();
    std::vector<std::vector<std::vector<std::complex<double>>>> X(nb);
    std::vector<std::vector<std::complex<double>>> mul(rows, std::vector<std::complex<double>>(cols));
    std::vector<std::vector<std::vector<double>>> result;

    for (size_t i = 0; i < nb; ++i) {
        X[i] = fft2(double_to_complex(this->tab[i]));
    }

    for (size_t idx = 0; idx < this->kernels.size(); ++idx) {
        for (size_t i = 0; i < rows; ++i) {
            for (size_t j = 0; j < cols; ++j) {
                mul[i][j] = X[this->sources[idx]][i][j] * this->kernels[idx][i][j];
            }
        }

        std::vector<std::vector<double>> U = complex_to_double(fft2(mul, true));
        result.push_back(U);
    }
    return result;
}

